function onCityChange(obj) {
    var ids = obj.id.split("_");
    var countySelect = document.getElementById(ids[0] + "_county");
    countySelect.length = 0;
    countySelect.options.add(new Option("请选择...", ""));
    if (obj.value != "0") {
        for (var i = 0; i < data.length; i++) {
            if ((obj.value & 16711680) == data[i].identity) {
                for (var j = 0; j < data[i].cities.length; j++) {
                    if ((obj.value & 16776960) == data[i].cities[j].identity) {
                        var counties = data[i].cities[j].counties;
                        for (var k = 0; k < counties.length; k++) {
                            countySelect.options.add(new Option(counties[k].name, counties[k].identity));
                        }
                    }
                }
            }
        }
    }
}
