//----------------得到【省份】的Json对象值 初始化下拉表值---------------//
function getSelect2ProvinceJsonData() {
    //构造省份的Json字符串
    var _dataSelectOption = "{";
    _dataSelectOption += "\"selectOptionData\": [";
    //循环构造
    for (i = 0; i < data.length; i++) {

        if (i >= (data.length - 1)) {
            //_provinceJsonData += "{ id: '" + data[i].identity + "', text: '" + data[i].name + "'}";
            _dataSelectOption += "{";
            _dataSelectOption += "\"id\": \"" + data[i].identity + "\",";
            _dataSelectOption += "\"text\": \"" + data[i].name + "\"";
            _dataSelectOption += "}";
        }
        else {
            //_provinceJsonData += "{ id: '" + data[i].identity + "', text: '" + data[i].name + "' },";
            _dataSelectOption += " {";
            _dataSelectOption += "  \"id\": \"" + data[i].identity + "\",";
            _dataSelectOption += "  \"text\": \"" + data[i].name + "\"";
            _dataSelectOption += "},";
        }
        //region_province.appendChild(new Option(data[i].name, data[i].identity));
    }
    _dataSelectOption += "]";
    _dataSelectOption += "}";
    //输出日志
    //console.log(_dataSelectOption);

    //返回Json对象
    //console.log(JSON.parse(_dataSelectOption).selectOptionData);
    return JSON.parse(_dataSelectOption).selectOptionData;
}

//----------------当省份改变时，得到相对应的【城市列表】的JSON对象数据-------------------//
//pProvinceLabelID 省份的Select的标签ID
function getCityJsonDataProvinceChange(pProvinceLabelID) {

    //alert(pSelectObject);

    //alert(pRegionCityLabelID);

    if (pProvinceLabelID == "") {
        return;
    }
    //alert(pSelectObject.value);
    var pProvinceIdentity = document.getElementById(pProvinceLabelID).value; //$("#" + pProvinceLabelID).val()

    if (pProvinceIdentity == "" || pProvinceIdentity == "0") {
        return;
    }

    for (var i = 0; i < data.length; i++) {
        //判断是否是要获取城市列表的省份identity
        if (pProvinceIdentity == data[i].identity) {

            //城市列表Json对象
            var _dataSelectOption = "{";
            _dataSelectOption += "\"selectOptionData\": [";
            //循环构造城市列表值
            var cities = data[i].cities;
            for (var j = 0; j < cities.length; j++) {
                //citySelect.options.add(new Option(cities[j].name, cities[j].identity));
                if (j >= (cities.length - 1)) {
                    //_provinceJsonData += "{ id: '" + data[i].identity + "', text: '" + data[i].name + "'}";
                    _dataSelectOption += "{";
                    _dataSelectOption += "\"id\": \"" + cities[j].identity + "\",";
                    _dataSelectOption += "\"text\": \"" + cities[j].name + "\"";
                    _dataSelectOption += "}";
                }
                else {
                    //_provinceJsonData += "{ id: '" + data[i].identity + "', text: '" + data[i].name + "' },";
                    _dataSelectOption += " {";
                    _dataSelectOption += "  \"id\": \"" + cities[j].identity + "\",";
                    _dataSelectOption += "  \"text\": \"" + cities[j].name + "\"";
                    _dataSelectOption += "},";
                }
            }
            _dataSelectOption += "]";
            _dataSelectOption += "}";

            //返回Json对象
            return JSON.parse(_dataSelectOption).selectOptionData;
        }
    }
}


//----------------当城市改变时，得到相对应的 【区县列表】的JSON对象数据-------------------//
//pCountyLabelID 区县的Select的ID  
//pProvinceLabelID  省份的Select的ID  
//pCityLabelID      城市的Select的ID
function getCountyJsonDataCityChange(pCountyLabelID, pProvinceLabelID, pCityLabelID) {

    if (pCountyLabelID == "") {
        return;
    }

    //alert("pCountyLabelID=" + pCountyLabelID);
    var pCountyIdentity = document.getElementById(pCountyLabelID).value.trim();
    //alert("pCountyIdentity=" + pCountyIdentity);

    var pProvinceIdentity = document.getElementById(pProvinceLabelID).value.trim();
    var pCityIdentity = document.getElementById(pCityLabelID).value.trim();

    //如果城市值为空
    if (pCityIdentity == "0" || pCityIdentity == "") {
        return;
    }

    for (var i = 0; i < data.length; i++) {

        if (pProvinceIdentity == data[i].identity) { //省份值

            for (var j = 0; j < data[i].cities.length; j++) {

                if (pCityIdentity == data[i].cities[j].identity) { //城市值

                    //循环构造县区列表值
                    var _dataSelectOption = "{";
                    _dataSelectOption += "\"selectOptionData\": [";

                    var counties = data[i].cities[j].counties;
                    for (var k = 0; k < counties.length; k++) { //区县值
                        //countySelect.options.add(new Option(counties[k].name, counties[k].identity));

                        if (k >= (counties.length - 1)) {
                            //_provinceJsonData += "{ id: '" + data[i].identity + "', text: '" + data[i].name + "'}";
                            _dataSelectOption += "{";
                            _dataSelectOption += "\"id\": \"" + counties[k].identity + "\",";
                            _dataSelectOption += "\"text\": \"" + counties[k].name + "\"";
                            _dataSelectOption += "}";
                        }
                        else {
                            //_provinceJsonData += "{ id: '" + data[i].identity + "', text: '" + data[i].name + "' },";
                            _dataSelectOption += " {";
                            _dataSelectOption += "  \"id\": \"" + counties[k].identity + "\",";
                            _dataSelectOption += "  \"text\": \"" + counties[k].name + "\"";
                            _dataSelectOption += "},";
                        }
                    }
                    _dataSelectOption += "]";
                    _dataSelectOption += "}";

                    //console.log(_dataSelectOption);
                    //返回Json对象
                    return JSON.parse(_dataSelectOption).selectOptionData;


                }

            }

        }

    }
}





//---------------------根据identity的ID号 查询【省份名称】-----------------------//
var searchProvinceByIdentity = function (pIdentityID) {
    for (var i = 0; i < data.length; i++) {
        if (data[i].identity == pIdentityID) {

            return data[i].name.toString().trim();
        }
    }
}

//---------------------根据identity的ID号 查询【城市名称】-----------------------//
var searchCityByIdentity = function (pIdentityID) {
    for (var i = 0; i < data.length; i++) {

        var cities = data[i].cities;
        for (var j = 0; j < cities.length; j++) {

            if (cities[j].identity == pIdentityID) {
                return cities[j].name.toString().trim();
            }

        }
    }
}

//---------------------根据identity的ID号 查询【区县名称】-----------------------//
var searchCountiesByIdentity = function (pIdentityID) {

    for (var i = 0; i < data.length; i++) {

        for (var j = 0; j < data[i].cities.length; j++) {

            var counties = data[i].cities[j].counties;
            for (var k = 0; k < counties.length; k++) {

                if (counties[k].identity == pIdentityID) {
                    return counties[k].name.toString().trim();
                }
            }

        }


    }

}


//----------------加载省份 初始化下拉表值---------------//
function initSelect2ProvinceValue() {
    var region_province = document.getElementById("region_province");

    region_province.appendChild(new Option("请选择...", ""));
    for (i = 0; i < data.length; i++) {
        region_province.appendChild(new Option(data[i].name, data[i].identity));
    }
    //region_province.appendChild(new Option("2121212", "121212"));
}


//-----------------初始化当前的 省份，城市，区县 值--------------------//
// pProviceCodeValue 省份值代号
// pCityCodeValue    城市值代号 
// pCountyValue      区县值代号
function setInitAreaValue(pProviceCodeValue, pCityCodeValue, pCountyValue) {

    //初始化下拉表值，加载省份
    initSelect2ProvinceValue();

    //省份
    $("#region_province").find("option[value='" + pProviceCodeValue + "']").attr("selected", true);
    //加载城市列表 
    onProvinceChange();

    //城市
    $("#region_city").find("option[value='" + pCityCodeValue + "']").attr("selected", true);
    //加载区县列表
    onCityChange();

    //区县
    $("#region_county").find("option[value='" + pCountyValue + "']").attr("selected", true);
}

